// src/components/Footer.js
import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: #333;
  color: white;
  padding: 1rem;
  text-align: center;
`;

function Footer() {
  return (
    <FooterContainer>
      &copy; 2024 Portfolio. Tous droits réservés.
    </FooterContainer>
  );
}

export default Footer;
